import './App.css';

import React, { Component } from 'react'
import Navbar from './Components/Navbar';
import News from './Components/News';
import {
  BrowserRouter as Router,
  Route,
  Routes,
  Link
} from "react-router-dom";

export default class App extends Component {
  render() {
    return (
      <>
        <div>
          <Router>
            {/* <Navbar /> */}
            <ul className="navbar-nav me-auto mb-2 mb-lg-0">
              <li className="nav-item"> <Link className="nav-link active" aria-current="page" to="/">Home</Link></li>
              <li className="nav-item"> <Link className="nav-link" to="/business">Business</Link> </li>
              <li className="nav-item"> <Link className="nav-link" to="/sport">Sports</Link> </li>
              <li className="nav-item"> <Link className="nav-link" to="/entertainment">Entertainment</Link> </li>
              <li className="nav-item"> <Link className="nav-link" to="/health">Health</Link> </li>
              <li className="nav-item"> <Link className="nav-link" to="/education">Education</Link> </li>
              <li className="nav-item"> <Link className="nav-link" to="/science">Science</Link> </li>
              <li className="nav-item"> <Link className="nav-link" to="/technology">Technology</Link> </li>
            </ul>
            <Routes>
              <Route exact path="/" element={<News country="us" category="general" />} />
              <Route exact path="/business" element={<News country="us" category="business" />} />
              <Route exact path="/entertainment" element={<News country="us" category="entertainment" />} />
              <Route exact path="/health" element={<News country="us" category="health" />} />
              <Route exact path="/education" element={<News country="us" category="education" />} />
              <Route exact path="/sports" element={<News country="us" category="sports" />} />
              <Route exact path="/science" element={<News country="us" category="science" />} />
              <Route exact path="/technology" element={<News country="us" category="technology" />} />
            </Routes>
            {/* <News country="us" category="" /> */}
          </Router>
        </div>
      </>
    )
  }
}
